import React, { Component } from 'react';
import ProductCard from './ProductCard';
class Product extends Component {
    state = {
        products: [{
            id: "60658e3db730c53260e6eb98",
            product_imageUrl: '{ "./11picture.jpg" }',
            product_model: "IdeaPad 3 14IML05",
            product_producer: "Lenovo",
            product_price: "890 AZN",
            product_category: "Noutbuk",
            product_date: "01.04.2021"
        }]
    }


    render() {
        return (
            <div className="product">
                <h3>{this.props.info.title}</h3>
                <b>{this.props.currentCategory}</b>
                <ProductCard
                    image={this.state.product_imageUrl}
                    model={this.state.product_model}
                    price={this.state.product_price}
                    date={this.state.product_price}
                    category={this.state.product_category}
                />
            </div>
        );
    }
}

export default Product;
